    async getToken() {
        let that = this;
        try{ 
            if(!that.utils.isEmpty(C.tokenData)){
                console.log("*****",C.tokenData, (new Date(C.tokenData.createdAt + parseInt(C.tokenData.expires_in))).getTime(),(new Date()).getTime() )
                if((new Date(C.tokenData.createdAt + parseInt(C.tokenData.expires_in))).getTime() < (new Date()).getTime()){
                    return C.tokenData.access_token;
                } else{
                    return await this.getNewToken();
                }
            } else{
                return await this.getNewToken();
            }
        } catch(ex){
            return null;
        }
    }

